import react, {useState} from "react";

export default function Formulario(){
  const [nombre,setNombre] = useState("");

  return(
   <>
    <h2>Formulario</h2>
    <form>
      <label htmlFor="nombre">Dia </label>
      <input 
      type="text"
      id="nombre"
      name="nombre"
      value={nombre}
      onChange={(e) => setNombre(e.target.value)}
      />
    </form>

   </>
  );
}
